(function($) {
	$.fn.initSmallChart = function(metal) {
		var options = {
				chart: {
					backgroundColor: '#EDEDED',
					renderTo: this[0],
					type: 'spline',
				},
				credits: {
					enabled: false
				},
				legend: {
					enabled: false
				},
				title: {
					text: ''
				},
				xAxis: {
					categories: [],
					tickWidth: 1,
					tickLength: 10,
					tickmarkPlacement: 'on',
					tickPosition: 'outside',
					labels: {
						y: 23,
						style: {
							fontSize: '9px'
						}
					}
				},
				yAxis: {
					allowDecimals: false,
					labels: {
						y: 2,
						style: {
							fontSize: '9px'
						}
					},
					tickPixelInterval: 25,
					title: {
						text: ''
					}
				},
				plotOptions: {
					spline: {
						lineWidth: 0.5,
						marker: {
							enabled: false
						}
					}
				},
				tooltip: {
					formatter: function() {
						return '<span style="font-size: 10px">' + this.x + '</span><br/>' +
							'<span style="color:' + this.series.color + '">' + this.series.name + '</span>: <b>' + Highcharts.numberFormat(this.y, 2) + '</b><br/>';
					}
				},
				series: [],
				colors: []
			},
			date, dateFrom, dateTo, link;

		date = new Date();
		dateTo = date.getDate() + '.' + (date.getMonth()+1) + '.' + date.getFullYear();
		date.setDate( date.getDate() - 30 );
		dateFrom = date.getDate() + '.' + (date.getMonth()+1) + '.' + date.getFullYear();
		link = accessPortal.metalJson + '?metal=' + metal + '&voeb=false&price=usd&dateFrom=' + dateFrom + '&dateTo=' + dateTo +'&outputMode=json&lang=' + $('html').attr('lang');

		$.ajax({
			url: link,
			cache: false,
			contentType: 'application/json; charset=utf-8',
			dataType: 'json',
			success: function (data) {
				// Push Categories
				options.xAxis.categories = data.categories;
				options.xAxis.tickInterval = parseInt(data.categories.length / 3.5);

				// Push Series
				options.series = data.series;
				options.series.pointInterval = 24 * 3600 * 1000;

				// Push Colors
				options.colors = [data.color];

				// Create the chart
				Highcharts.setOptions({
					lang: {
						decimalPoint: accessPortal.decimalSep,
						thousandsSep: accessPortal.thousandSep
					}
				});
				accessPortal.chart.push( new Highcharts.Chart(options) );
			}
		});
	};

	$.fn.initFilterSlider = function(width) {
		return this.each(function() {
			$(this).before('<span class="next"></span>')
				.after('<span class="prev"></span>')
				.caroufredsel({
					items: {
						visible: {
							min: 5,
							max: 25
						}
					},
					responsive: true,
					infinite: false,
					circular: false,
					auto: false,
					prev: ".prev",
					next: ".next",
					swipe: true,
					width: width
				});
		});
	}
})(jQuery);